import React from "react";

function AIDoctor() {
  return (
    <div className="chat-view w-full h-full flex justify-center items-center">
      <div className="chat-body w-full h-screen m-10 flex justify-center items-center rounded-3xl shadow-animate relative">
        <div className="chat w-full h-full bg-[#202024] text-white  rounded-3xl m-10 z-10 flex flex-col justify-center items-center">
          <h2 className="text-2xl">AI Doctor Card</h2>
          <p className="text-gray-400 mt-4">
            This is an animated shadow card example.
          </p>
        </div>
      </div>
    </div>
  );
}

export default AIDoctor;
